import React from "react";
import "./Home.css";
const Home = () => {
  return (
    <>
      <section className="container">
        <div className="">
          <h1 className="welcome-heading inline ">
            <p>Welcome to </p> <span>Udaan</span>
          </h1>
        </div>
      </section>
    </>
  );
};

export default Home;
